import React from 'react';
import './styles.css';
import { Link } from 'react-router-dom';
import GetMockData from './GetMockData'

const select = [
    {index: 0, name: 'Breakfast', food: 'bread', products: ['bread', 'eggs', 'milk']},
    {index: 1, name: 'Dinner', food: 'eggs', products: ['steak', 'ketchup', 'fries']},
    {index: 2, name: 'Snacks', food: 'chips', products: ['chips', 'grapes', 'cookies']},
    {index: 3, name: 'Drinks', food: 'pepsi', products: ['Pepsi', 'Coke', 'orange juice']},
]

export class ShoppingList extends React.Component {
    render() {
        return(
            <section className="listoflists">
                <h1>Shopping Lists</h1>
var chosenList = 2;
                if (chosenList == 0) {
                    <p>
                        <GetMockData
                            key={select[0].name}
                            name={select[0].name}
                            food={select[0].food}
                        />
                    </p>
                } else (chosenList == 1) {
                    <p>
                        <GetMockData
                            key={select[1].name}
                            name={select[1].name}
                            food={select[1].food}
                        />
                     </p>
                } else (chosenList == 2) {
                    <p>
                        <GetMockData
                            key={select[2].name}
                            name={select[2].name}
                            food={select[2].food}
                        />
                    </p>
                } else (chosenList == 3) {
                    <p>
                        <GetMockData
                            key={select[3].name}
                            name={select[3].name}
                            food={select[3].food}
                        />
                    </p>
                } else {
                    
                }


                </section>
        );
    }

}
export default ShoppingList;
